    int KNN::return_int(char a)
    {
        if (a =='0')
            return 0;
        else if (a == '1')
            return 1;
        else if (a == '2')
            return 2;
        else if (a == '3')
            return 3;
        else if (a == '4')
            return 4;
        else if (a == '5')
            return 5;
        else if (a == '6')
            return 6;
        else if (a == '7')
            return 7;
        else if (a == '8')
            return 8;
        else if (a == '9')
            return 9;
        else
            return -1;
    }
    int KNN::returnQuadrant (float positionX, float positionY)
    {
        int quadrant;

        if(positionX <=37.5)
        {
            if(positionY <= 35)
            {
                quadrant = 3;
            }
            else if(positionY > 35 && positionY <= 95)
            {
                quadrant = 2;
            }
            else if(positionY > 95 && positionY <= 130)
            {
                quadrant = 1;
            }
        }
        else if(positionX > 37.5 && positionX <= 75)
        {
            if(positionY <= 35)
            {
                quadrant = 6;
            }
            else if(positionY > 35 && positionY <= 95)
            {
                quadrant = 5;
            }
            else if(positionY > 95 && positionY <= 130)
            {
                quadrant = 4;
            }
        }
        else if(positionX > 75 && positionX <= 112.5)
        {
            if(positionY <= 35)
            {
                quadrant = 9;
            }
            else if(positionY > 35 && positionY <= 95)
            {
                quadrant = 8;
            }
            else if(positionY > 95 && positionY <= 130)
            {
                quadrant = 7;
            }
        }
        else if(positionX > 112.5 && positionX <= 150)
        {
            if(positionY <= 35)
            {
                quadrant = 12;
            }
            else if(positionY > 35 && positionY <= 95)
            {
                quadrant = 11;
            }
            else if(positionY > 95 && positionY <= 130)
            {
                quadrant = 10;
            }
        }
        return quadrant;
    }

